import React from 'react';
import Button from 'react-bootstrap/Button'
import { ImCross } from 'react-icons/im';




const ConfirmWindow = () => {


    return (
        <div className='confirm-window'>
            <div className='confirm-window-frame'>
                <div className='confirm-window-top'>
                    <h1 className=''>Supprimer photo</h1>
                    <Button variant="dark" className='centerElementsInPage' style={{width: 'fit-content', height: '100%'}}>
                        <ImCross size='10' />
                    </Button>
                </div>
                <div className='confirm-window-middle'></div>
                <div className='confirm-window-bottom'>
                <Button variant="primary">Confirmer</Button>
                <Button variant="outline-danger">Annuler</Button>
                </div>
            </div>
        </div>
    )
}

export default ConfirmWindow;
